import React from 'react';
import logo from './logo.svg';
import fremont from './fremont.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to my Website</h1>
        <p></p>
        <h2>Who I am</h2>
        <p> My name is Brian Wang and I am currently a first-year student at Dartmouth College.  
          I am currently quarantining in Fremont, California of the San Francisco Bay Area. </p>
        <img src={fremont} />
        <h2>What I like</h2>
        <h2>What I want to become</h2>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
